Key points (best‑effort, verify against latest docs)
- Next.js 15 makes `cookies()` and `headers()` async in the App Router, so use `await cookies()` / `await headers()` in server components, route handlers, and server actions.
- Supabase SSR uses `createServerClient` from `@supabase/ssr` and a cookie adapter. The server client needs read/write cookie access for session refresh.

Example SSR helper (App Router)
```ts
// lib/supabase/server.ts
import { createServerClient } from '@supabase/ssr';
import { cookies, headers } from 'next/headers';

export async function createClient() {
  const cookieStore = await cookies();
  // If you need headers for debugging/logging or other auth logic:
  const headerStore = await headers();

  return createServerClient(
    process.env.NEXT_PUBLIC_SUPABASE_URL!,
    process.env.NEXT_PUBLIC_SUPABASE_ANON_KEY!,
    {
      cookies: {
        get(name) {
          return cookieStore.get(name)?.value;
        },
        set(name, value, options) {
          cookieStore.set({ name, value, ...options });
        },
        remove(name, options) {
          cookieStore.set({ name, value: '', ...options, maxAge: 0 });
        },
      },
      // headers: { ... } // not typically required by createServerClient
    }
  );
}
```

Using it in a Server Component
```ts
// app/page.tsx
import { createClient } from '@/lib/supabase/server';

export default async function Page() {
  const supabase = await createClient();
  const { data } = await supabase.from('todos').select('*');
  return <pre>{JSON.stringify(data, null, 2)}</pre>;
}
```

